def define_xls(heat, dd):

    results = xlwt.Workbook(encoding="utf-8")
    sheet1 = results.add_sheet('heat_map')

    for k in range(0, dd):
        for i in range(0, dd):
            sheet1.write(i, k, heat[k][i])

    # results.save("heat_OLD_"+str(dd)+".xls")
    # results.save("heat_N03_"+str(dd)+".xls")
    # results.save("heat_N06_"+str(dd)+".xls")
    results.save("heat_N09_"+str(dd)+".xls")


def create_heat_map(div):
    heat_array = []
    split = np.array_split(new9, div)

    for i in range(0, len(split)):
        part = split[i]
        hh = []
        for j in range(0, len(part)):
            hh.append(part[j])
        heat_array.append(hh)

    final = np.zeros((div,div))
    for i in range(0, len(heat_array)):
        pp = heat_array[i]
        for j in range(0, len(pp)):
            ind = int(pp[j]*div)
            final[i][ind-1] += 1
    define_xls(final, div)


